var html='<div id="loading" style="display:none;text-align:center;line-height:100%; top:0px; left:0px; position:fixed; width:100%; height:100%;border:1px solid #000; background-color:#000;filter:alpha(opacity=50);opacity:0.5;zoom:1; z-index:9000;"><table width="100%" height="100%" border="1" bordercolor="#006699" cellspacing="0" cellpadding="0" align="center"><tr><td align="center"><img src="data:image/gif;base64," width="300" height="300"/><div id="loading_msg" style="font-size:15px; color:#FFF; font-weight:bold; margin-top:-80px; z-index:9999;"></div></td></tr></table></div>';
document.writeln(html);
$(document).ready(function(){
	//設定loading與ajax對應動作
	$(document).bind("ajaxSend", function(){ 
		$("#loading").show();
	}).bind("ajaxComplete", 
		function(evt,xhr,opts){
			doneLoading();
		}
	);
});
function doneLoading() { $("#loading").hide(); $("#loading_msg").html(''); } 